import React, { useState } from "react";
import styles from "./Homepage.module.scss";

function Homepage() {
  const [videoName, setVideoName] = useState("tree");

  return (
    <div className={styles.homepage}>
      <video className={styles.homepage__video} autoPlay loop muted>
        <source src={`/assets/video/${videoName}.mp4`} type="video/mp4" />
        Your browser doesn't support video.
      </video>

      <img src={`/assets/video/Logo.png`} alt="Logo" className={styles.homepage__logo}/>
    </div>
  );
}

export default Homepage;
